import React from 'react';
import { Link } from 'react-router-dom';
import './Signin.css';

function Signin() {
  return (
    <div className="signin-container">
      <div className="signin-logo">StreamFlix</div>
      <h1 className="signin-title">Sign In</h1>
      <input className="signin-input" type="email" placeholder="Email address" />
      <input className="signin-input" type="password" placeholder="Password" />
      <button className="signin-btn">Sign In</button>
      <div className="signin-footer">
        New to StreamFlix? <Link to="/signup">Sign up now.</Link>
      </div>
    </div>
  );
}

export default Signin;
